import DesktopData from "./json/desktop.json";
import AndroidData from "./json/android.json";
import iosData from "./json/ios.json";

function addContent(type, refresh, setRefresh){
    var cur;
    var ret = <><h1 className="middle">{type}</h1><span className="middle">No content availible.</span></>;
    switch (type) {
        case "Desktop":
            cur = DesktopData;
        break;
        
        case "Android":
            cur = AndroidData;
        break;

        case "Ios":
            cur = iosData;
    } 

    if(cur.Name.length > 0){
        ret = <></>;
        for (var index = 0; index < cur.Name.length; index++) {
            if(ret == <></>) ret = <>{createWiget(cur.Name[index], cur.Img[index], cur.Github[index], cur.Download[index], refresh, setRefresh)}</>
            else ret = <>{ret}{createWiget(cur.Name[index], cur.Img[index], cur.Github[index], cur.Download[index], refresh, setRefresh)}</>;
        }
    }

    return ret;    
}

function createWiget(name, img, github, download, refresh, setRefresh) {
    return (<>
        <div>        
            <span className="middle">{name}</span>
            <div className="middle">
                <img className="clickable" onClick={() => { createPopUP({name}, {img}, {github}, {download}); setRefresh(refresh +1)}} src={img}/>
            </div>
           
        </div>
    </>);
}

const Popup = props => {
